window.bookSummaryJSON = "<p><b>I'm not just going to make her mine. I'm going to make her call me daddy.</b></p> <p>Caitlin McCormick is used to doing as she pleases, but that's about to change.</p> <p>She's sitting on a bright red bottom because I promised her father I would look out for her. She's in my private jet on her way back to Boston with me because she needs something more—a daddy. One who will spank her when she's been naughty, then pin her to the wall and take what is his.</p> <p>What really makes her blush isn't that I didn't give her a choice. It's that we both know she didn't want one.</p> <p><i>Make Me, Daddy</i> is a standalone novel in the Boston Kings series. It includes spankings and rough, intense sexual scenes.</p>"; 
